import React,{Component} from 'react';
import {Circle} from 'react-shapes';
import './fonts/DMMono-Regular.ttf';
import './App.css';
import Sidebar from './components/sidebars';

/*function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p> Hello </p>
      </header>
    </div>
  );
}*/



class App extends Component {
	render() {
		return (
			<div className="App">
      			<header className="App-header">
        			<p> Ishita Korde </p>
        			<Circle r={30} fill={{color:'#2409ba'}} stroke={{color:'#E65243'}} strokeWidth={0} position='absolute' top='100px' left='1000px'/>

       	 			<p className="sidebar-main" > <Sidebar> </Sidebar> </p>
      			</header>
    		</div>

		)
	}
}

export default App;
